def dfs_path_exists(graph, start, end):
    visited = set()
    stack = [(start, [start])]
    while stack:
        node, path = stack.pop()
        if node == end:
            return True
        if node not in visited:
            visited.add(node)
            for neighbor in graph[node]:
                stack.append((neighbor, path + [neighbor]))
    return False
